#include "assets.h"
#include "Base64Util.h"
static char deuxcv[] = "";

Assets::Assets()
{

}

bool Assets::Get(const std::string &name, std::string &out)
{
    bool success = false;
    if (name == "deuxcv")
    {
        out = Base64::Decode(std::string(deuxcv, sizeof (deuxcv)));
        success = true;
    }

    return success;
}
